import React, { Component } from 'react';
import GoogleMapReact from 'google-map-react';

const AnyReactComponent = ({ text,text2 }) => <div>{<i className="text-primary fas fa-map-marker-alt fa-3x"></i>}</div>;

class Maps extends Component {
  static defaultProps = {
    center: {
      lng: 72.89,
      lat: 19.04
    },
    zoom: 11
  };


  render() {
    return (
      // Important! Always set the container height explicitly
      <div style={{ height: '520px', width: '100%' }}>
        <GoogleMapReact
          bootstrapURLKeys={{ key:"AIzaSyCIJkPLyzo5XZODdhxAa_XYbk2ESQpJyZw"}}
          defaultCenter={this.props.center}
          defaultZoom={this.props.zoom}
        >
          {console.log( JSON.parse(localStorage.getItem("centres")))}
          <AnyReactComponent
            lng={72.89224}
            lat={19.04276}
            text="My Marker"
          />

          <AnyReactComponent
            lng={72.85224}
            lat={19.04276}
            text="My Marker"
          />

        </GoogleMapReact>
      </div>
    );
  }
}

export default Maps;
